import React from "react";
import {ContentList} from './contentStyles';

function Content() {
    return (
        <ContentList>
            <h3>Title</h3>
            <div className="img"></div>
            <div className="username"></div>
            <div className="desc"></div>
        </ContentList>
    )
}

export default Content;
